export default function arondissements() {
    const lyon1 = document.getElementById('lyon1');
    const lyon2 = document.getElementById('lyon2');
    const lyon3 = document.getElementById('lyon3');
    const lyon4 = document.getElementById('lyon4');
    const lyon5 = document.getElementById('lyon5');
    const lyon6 = document.getElementById('lyon6');
    const lyon7 = document.getElementById('lyon7');
    const lyon8 = document.getElementById('lyon8');
    const lyon9 = document.getElementById('lyon9');
    let map = document.getElementById('map');

    lyon1.addEventListener('click', function () {
        map.center = [45.7597, 4.8422];
        map.zoom = 9;
    }, false);
}
